import React, { Component } from "react";

class MainProfile extends Component {
  render() {
    const {
      avatar,
      user,
      handle,
      status,
      skills,
      company,
      website,
      location,
      github
    } = this.props;
    return (
      <div>
        <h4>Main profile</h4>
      </div>
    );
  }
}
export default MainProfile;
